El propósito: objetivo que se pretende alcanzar. 

Parte de mi propósito de vida es ayudarte, enseñarte, motivarte a alcanzar el tuyo, a eso vine y definitivamente me llena de vida. Este video está lleno de cosas lindas que otras personas dicen de mi, escucharlo me hace pensar que voy por buen camino.

Editar este video me hizo llorar a mares porque me siento muy afortunada de tener personas tan increíbles a mi alrededor, me gusta lo que atraigo y me hace reafirmar mi propósito. Gracias porque aunque no lo sepas me inspiras todos los días. 

Estas palabras lindas las recibo después de mis clases, en mis mensajes directos, en mis conversaciones contigo y los últimos videos fueron recibiendo mi journal Plan Yourself. 

Graciaaaaas infinitas
